message:
O BRASIL EMPENHADO NA EDUCAÇÃO INFANTIL / ALFABETIZAÇÃO (buscando sair dos últimos lugares de avaliação mundial de educação, sendo herança deixada pelos governo anteriores)  :

. Criada uma secretaria dedicada exclusivamente à ALFABETIZAÇÃO;

. Instituiu-se a Política Nacional de Alfabetização (PNA),
com diretrizes para uma abordagem técnica, primando por critérios científicos;

. Programa TEMPO DE APRENDER: Investe na formação docentes e gestores, em recursos para alunos e professores e no acompanhamento da evolução dos alunos;

• Programa CONTA PRA MIM: programa de estímulo à leitura e à contação de histórias no ambiente familiar;

. O governo aderiu ao PIRLS, exame internacional que mede o nível de leitura das crianças para aperfeiçoar medidas o aplica o SAEB (Avallação da Educação Básica) anualmente;

. Aplicativo GRAPHOGAME: aplicativo gratuito que simplifica a aprendizagem infantil e garante apoio no ensino mesmo que remoto;

. Curso Alfabetização Baseada na Clência (ABC): fruto da cooperação internacional de instituições do Brasil e de Portugal, o curso prepara os professores para garantir sucesso na aprendizagem da leitura.

Inversão da lógica eleitoreira das últimas décadas:

- Como criança não vota, PSDB e PT negligenciaram a educação infantil.
- FHC, Lula e Dilma fizeram das universidades celeiros de militantes.
- O Presidente Jair Bolsonaro investiu pesado na alfabetização.
- Deu atenção especial ao Ensino Profissionalizante, esperança para milhões de brasileiros.

. PISO SALARIAL
- Aumento histórico de 33,24% no salário para os professores da Educação Básica em 2022;
- Maior correção desde o surgimento da Lei do Piso;
- Piso em 2022 no valor de R$ 3.845,63;
-  Mais de 1.7 milhão de docentes beneficiados em todo o país.

Criação do Programa de Escolas Cívico-Militares, ajudando escolas em situação de vulnerabilidade social e facilitando a atuação dos professores.

A parceria histórica entre o MEC e Ministério da Defesa já resultou em 127 escolas com o programa implementado.

. Criação da Secretaria de Alfabetização:
- Implementação da Política Nacional de Alfabetização (PNA), que auxilia professores em sua qualificação.
- Alfabetização Baseada na Ciência (ABC), com 245 mil inscritos e 8,7 milhões de acessos. 
-Programa Tempo de Aprender:
- Formação de mais de 156 mil professores

. INVESTIMENTOS DIVERSOS NA EDUCAÇÃO

- R$ 178 milhões para a formação de professores via CAPES em 2021;
- R$ 275,9 bilhões repassados para escolas públicas desde 2019;
- R$ 61,1 bilhões de repasses pelo FUNDEB;
- R$ 43,5 bilhões pelo Salário-Educação;
- R$ 14,1 bilhões pelo FIES;
- R$ 2,2 bilhões pelo Programa Nacional de Apoio ao Transporte Escolar;
- R$ 5,3 bilhões pelo Programa Dinheiro Direto na Escola
- R$ 13,1 Bilhões pelo Programa Nacional de Alimentação Escolar (PNAE) até março de 2022;
- R$ 6,8 bilhões para Programa Nacional do Livro e do Material Didático (PNLD) até março de 2022;
- R$ 3,5 bilhões para garantir acesso à internet a professores e alunos da rede pública.
